	uckeys=[]
	for offset in r[repr(nameToDBName['key'])]:
		s=recov_uckey(fd, offset)
		if s:
			uckeys.append(s[4])
	uckeys = list(set(uckeys))
	print('Found %d possible unencrypted keys'%len(uckeys))


	os.close(fd)


	list_of_possible_keys_per_master_key=dict(map(lambda x:[x[1],[]], mkeys))
